import { createRouter, createWebHistory } from 'vue-router'


import App from '/App.vue'
//import StartPage from '../views/StartPage.vue'
import RegistrationPage from '../views/RegistrationPage.vue'
import MenuRegister from '../components/MenuRegister.vue'
import CpTeste from '../components/CpTeste.vue'



const routes = [
  //{ path: '/startPage', component: StartPage },
  //{ path: '/registrationPage', component: RegistrationPage },
  //{ path: '/lauchPage', component: LauchPage }
  {
    path: '/app',
    components: App,
    registrationPage: RegistrationPage,
  },

  {
    path: '/registrationPage',
    components: RegistrationPage,
    default: RegistrationPage,
    menuRegister: MenuRegister,
    cpTeste: CpTeste
  }



];



const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})



export default router
